import classes from './Modal.module.css';
import Card from '../UserInterface/Card';
import { Link } from 'react-router-dom';
import { useFormik } from "formik";


function Modal(props){
    const click = props.clickButtons;

    const formik = useFormik({
        initialValues: {

        },
        onSubmit: values => {
            console.log(values);
        }
    });

    return (
        <Card>
        <div className={classes.modal}>
            <p>
                Login Here
            </p>
            <div>
                <form>
                    <p className={classes.criteria1}>Enter your IITG mail-id</p>
                    <input className={classes.input1} type="text" placeholder="include@iitg.ac.in" />
                    <p className={classes.criteria2}>Enter Password</p>
                    <input className={classes.input2} type="password" />
                </form>
            </div>
            <div>
                <button type='submit' className={classes.btn} onClick={click}>Login</button>
            </div>
            <div>
                <Link to='/'>
                    Forgot Password?
                </Link>
            </div>
            <div>
                <Link to='/'>
                    <button type='button'>Create New Account</button>
                </Link>
            </div>
        </div>
        </Card>
    );
}
 
export default Modal;
